import React, { useState } from "react"; 
import { DndContext, closestCenter } from "@dnd-kit/core";
import { SortableContext, useSortable, arrayMove } from "@dnd-kit/sortable";
import { CSS } from "@dnd-kit/utilities";
import { FaTrash } from "react-icons/fa";
import "./App.css";
import Table from "./table.js";

let blockIdCounter = 0;

export default function App() {
  const [activeTab, setActiveTab] = useState("tab1");
  const [tabs, setTabs] = useState([
    { id: "tab1", name: "頁簽 1" },
    { id: "tab2", name: "頁簽 2" },
    { id: "tab3", name: "頁簽 3" }
  ]);

  const [tabContents, setTabContents] = useState({
    tab1: [],
    tab2: [],
    tab3: []
  });

  const addBlock = (type) => {
    const blockId = `block-${blockIdCounter++}`;

    const newBlock = {
      id: blockId,
      type: type
    };

    setTabContents(prevContents => ({
      ...prevContents,
      [activeTab]: [...prevContents[activeTab], newBlock]
    }));
  };

  const deleteBlock = (blockId) => {
    setTabContents(prevContents => ({
      ...prevContents,
      [activeTab]: prevContents[activeTab].filter(block => block.id !== blockId)
    }));
  };

  const handleDragEnd = (event) => {
    const { active, over } = event;
    if (!over || active.id === over.id) return;

    setTabContents(prevContents => {
      const newBlocks = arrayMove(
        prevContents[activeTab],
        prevContents[activeTab].findIndex(block => block.id === active.id),
        prevContents[activeTab].findIndex(block => block.id === over.id)
      );
      return {
        ...prevContents,
        [activeTab]: newBlocks
      };
    });
  };

  return (
    <div className="container">
      <div className="left-panel">
        <div className="tabs">
          {tabs.map((tab) => (
            <div
              key={tab.id}
              className={`tab ${activeTab === tab.id ? "active" : ""}`}
              onClick={() => setActiveTab(tab.id)}
            >
              {tab.name}
            </div>
          ))}
        </div>
      </div>

      <div className="right-panel">
        <input
          type="text"
          value={tabs.find(tab => tab.id === activeTab)?.name}
          onChange={(e) =>
            setTabs(tabs.map(tab => (tab.id === activeTab ? { ...tab, name: e.target.value } : tab)))
          }
          className="tab-title-input"
        />

        <DndContext collisionDetection={closestCenter} onDragEnd={handleDragEnd}>
          <SortableContext items={tabContents[activeTab].map(block => block.id)}>
            {tabContents[activeTab].map(block => (
              <SortableBlock key={block.id} block={block} deleteBlock={deleteBlock} />
            ))}
          </SortableContext>
        </DndContext>

        <button onClick={() => addBlock("text")} className="add-block-btn">
          + Add Text Block
        </button>
        <button onClick={() => addBlock("sheet")} className="add-block-btn">
          + Add Sheet Block
        </button>
      </div>
    </div>
  );
}

function SortableBlock({ block, deleteBlock }) {
  const { attributes, listeners, setNodeRef, transform, transition } = useSortable({ id: block.id });

  const style = {
    transform: CSS.Transform.toString(transform),
    transition,
    display: "flex",
    alignItems: "center",
    padding: "10px",
    border: "1px solid #ddd",
    borderRadius: "5px",
    marginBottom: "10px",
    background: "white",
    cursor: "grab"
  };

  return (
    <div ref={setNodeRef} style={style} {...attributes} {...listeners}>
      <FaTrash className="delete-icon" onClick={() => deleteBlock(block.id)} />
      {block.type === "text" ? (
        <textarea placeholder="在這裡輸入文字..." className="text-block" />
      ) : (
        <Table />
      )}
    </div>
  );
}
